import styled from 'styled-components'

export const Container = styled.div`
  width: 100%;
  height: 150px;
  border-bottom: 1px solid rgb(1, 63, 28);
  align-content: center;
  align-items: center;
  justify-content: center;


  h1 {
    padding: 30px 0 5px 30px;
    color: rgb(1, 63, 28);
  }

  p {
    padding: 5px 0 10px 40px;
  }
`
